import React, {useState} from 'react';
import Lab from './Lab'
import {Grid } from '@mui/material'
import { makeStyles } from '@material-ui/core'
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import CardActionArea from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';

let labsOne = [
  {
    name: 'Links',
    date: '2022-08-21',
    description: 'Collaborative Outline',
    link: 'https://docs.google.com/document/d/e/2PACX-1vR7jlgRnLbmj4f9BdjjqILT4Q8ekHBQ1AzZIkhHakZjiDT2QDpntU0kzajhPsvZiklaRipNG7ys2dxd/pub?embedded=true',
  },
  {
    name: "Glossary",
    date: '',
    description: '',
    link: 'https://docs.google.com/document/d/e/2PACX-1vR7jlgRnLbmj4f9BdjjqILT4Q8ekHBQ1AzZIkhHakZjiDT2QDpntU0kzajhPsvZiklaRipNG7ys2dxd/pub?embedded=true',
  },
  {
    name: 'References',
    date: '',
    description: '',
    link: 'https://docs.google.com/document/d/e/2PACX-1vR7jlgRnLbmj4f9BdjjqILT4Q8ekHBQ1AzZIkhHakZjiDT2QDpntU0kzajhPsvZiklaRipNG7ys2dxd/pub?embedded=true',
  },

]


const References = () => {

  return (
    <div>
      <div id="lab1">
              <Typography variant='h3'>
            Lab I
        </Typography>
        <Divider>
          </Divider>
            <Grid container spacing={2}>
        {labsOne.map((lab) => {
          return (
            <Grid item xs={12} sm={6} md={4}>
              <Lab key={lab.name} lab={lab} />
            </Grid>
          )
          })}
      </Grid>
      </div>
      <br></br>
      <div id="lab2">
              <Typography variant='h3'>
            Lab II
        </Typography>
        <Divider>
          </Divider>
            <Grid container spacing={2}>
        {labsTwo.map((lab) => {
          return (
            <Grid item xs={12} sm={6} md={4}>
              <Lab key={lab.name} lab={lab} />
            </Grid>
          )
          })}
      </Grid>
      </div>
      <div id="lab3">
              <Typography variant='h3'>
            Lab III
        </Typography>
        <Divider>
          </Divider>
            <Grid container spacing={2}>
        {labsThree.map((lab) => {
          return (
            <Grid item xs={12} sm={6} md={4}>
              <Lab key={lab.name} lab={lab} />
            </Grid>
          )
          })}
      </Grid>
      </div>
    </div>
  )
}

export default References
